import React from "react";

const SingleQuestionItem = () => {
  return (
    <div className="bg-white">
      <p cl>What is lorem impsum?</p>
      <p>
        WeAbove is an NFT collection conceived and created by world-renowned
        artists specialized in 2D and 3D animation. Follow the exciting story of
        3 factions (Ordos, Altari, Freo) trying to survive in a world where
        gravity has been shaken by a powerful mineral.
      </p>
    </div>
  );
};

export default SingleQuestionItem;
